import React from "react"
const csstyle = {}
var time = new Date().getHours()
var greet = ''
if(time > 7 && time < 11){
    greet = "Good Morning"; 
    csstyle.color = "green";
}else if (time > 11 && time < 19) {
    greet = "Good Afternoon";
    csstyle.color = "orange";
} else {
    greet = "Good night";
    csstyle.color = "black";
    };

function Heading (){
    return  <h1>Hello , <span style={csstyle}>{greet}</span></h1>
}

function Card(props){
    return (
        <>
        <div className="cards">
            <div className="card">
                <img src={props.imgsrc} alt="pic" className="cardimg"></img>
                <div className="detials">
                    <span className="catog">{props.catorg}</span>
                    <h3 className="title">{props.title}</h3>
                    <a href={props.link} target= "_blank">
                        <button>Watch Now</button>
                    </a>
                </div>
            </div>

        </div>
        </>
    )
}

export default Heading;

export {time,Card};
